import React from "react";

const blurbStyle = {
    // display: "flex",
    // flexDirection: "column",
    // width: "500px"
    gridColumn: "4 / 5"
};

const paragraph = {
    margin: "0px"
}

const title = {
    fontSize: "20px",
    margin: "0px"
}

export const TextBlurb = ({ ...props }) => (
    <div style={blurbStyle}>
        <h1 style={title}> {props.title} </h1>
        <p style={paragraph}> {props.text} </p>
    </div>
)

export default TextBlurb;
